import React from "react";
import styled from "styled-components";
import AppBar from "../components/AppBar";

export default function Home() {
  return (
    <div>
      <WrapBox>
        <>
        <AppBar />
        </>
      </WrapBox>
    </div>
  );
}

const WrapBox = styled.div`
  background: linear-gradient(to bottom, #000000, #4f4f51);
  height: 100%;
`;
